    false,nt"url": null,nt"notes": "This vegetation mapping project of Suisun
    Marsh blends ground-based classification, aerial photo interpretation, and GIS editing
    and processing. The method is based on the development of a quantitative vegetation
    classification, which is used to describe the vegetation map units of the marsh.
    The classification is defined to meet the specifications of the National and State
    standards for vegetation classification, but is related through a cross-walking
    table to other standard classifications in use locally or statewide ( http://www.nrm.dfg.ca.gov/FileHandler.ashx?DocumentID=24570
